(2990,5,4,10,NULL,'2018-11-02 11:14:09','建议部宣传局在今后的培训中分档次(高.中.低)各省市区按照档次选派固定人员有针对性的参入，每期就一到二个主题(相关主题培训时间还可延长)：精神分析或危机干预或行为训练等等。\n督促相关省市区建立民警心理健康服务中心(我们省有相当一部分地市到现在都未建立，更别提专兼职人员。\n继承夸省交流学习，参照14年15年模式很不错。省与省之间可以相互交流学习，取长补短。\n\n','127.0.0.1'),
