(3062,5,4,10,NULL,'2018-11-02 11:20:33','基地环境优美，教官和工作人员贴心服务，老师授课水平高，满满的感动和温暖，期待能有机会再次参加培训！建议:1.可以多留二次时间开展内部交流，让大家更多熟悉和交流；2.培训时间还可以再长一点，也可开展某一类专业学习专项培训（如专门危机干预班6-10天），促进学习更深入。谢谢部领导、四川省厅的精心安排部署！感恩遇见！','127.0.0.1'),
