(3080,5,4,10,NULL,'2018-11-02 11:23:39','整体很好。希望在今后：\n1.期待多举办类似的心理培训班；\n2.可以尝试邀请一些心理咨询行业专业人士授课，比如朱建军、孙时进等国内心理疗法创始人授课。\n3.授课可以更加专业深入些，两三小时的讲座更多只是简单介绍，蜻蜓点水，可以尝试持续两天一位专家，系统讲授。\n谢谢。','127.0.0.1'),
