(3097,5,3,9,5,'2018-11-02 11:39:53',NULL,'127.0.0.1'),
(3098,5,4,10,NULL,'2018-11-02 11:39:53','1.部里邀请国内心理大咖开展集中培训，及时满足了全国公安心理工作者的进阶需求，作为年度培育计划，建议每年持续开展。\n2.劳人部国家咨询师证书取消后，广大公安干警缺少统一的认证培训，尤其是想要进入心理骨干队伍中的警察，建议部里依托警察大学和公安大学等直属院校制定公安民警心理骨干培训体系，开展行业认证，每年开展一两次培训，保持公安心理队伍的长期发展。\n3.本次培训增加了全国公安心理健康服务骨干之间的交流，但是缺乏平时之间工作经验的分享和交流的平台。建议部里建立平台，便于平时交流，目前警察大学依托公安部课题正在开发的“警心”app能够实现公安心理健康知识推送、专业心理测量及结果、心理自我调试小游戏训练、相关心理培训录像、在线心理疏导及交流等模块，作为一款手机软件可以随时了解心理健康状况，成长警察口袋里的心理专家。但是目前开发和推广还未完全完成，作为暖警惠警的内容，部里能否统一推广。\n4.中国人民警察大学作为新成立的警察类本科院校，在心理健康服务方面有一定的基础，建有独立三层楼占地900多平米的心理健康活动中心，具有心理咨询、心理训练、心理测评、心理教育和心理研究等功能，承担过多次外警心理培训和高级警官培训的心理任务。警察大学也具有承担各类培训的经验，今后部里有关心理方面的培训是否可以放在警察大学，大学地处廊坊与北京天津较近，交通方便。','127.0.0.1'),
